// インタラクティビティの追加を学ぶ

// イベントハンドラにおいてpropsの読み取りを実施したいと思います。

function AlertButton({ message, children }) {
  function handleClick() {
    alert(message);
  }


  return <button onClick={handleClick}>{children}</button>;
}

export default function App() {
  // 動画のアップロードと画像のアップロードについて

  return (
    <>
      <AlertButton message="画像アップロード中です">
        画像アップロード
      </AlertButton>
      <AlertButton message="動画アップロード中です">
        動画アップロード
      </AlertButton>
    </>
  );
}
